import React, { useState } from "react";
import { Jumbotron, Form, Button } from "react-bootstrap";
import DropdownButton from "react-bootstrap/DropdownButton";
import Dropdown from "react-bootstrap/Dropdown";
import "../../App.css";
export const AddTicketForm = (handleOnChange, handleOnSubmit) => {
  const [value, setValue] = useState("Selectioner");
  const handleSelect = (e) => {
    console.log(e);
    setValue(e);
  };
  return (
    <Jumbotron className="jumbotron">
      <Form autoComplete="off" onSubmit={handleOnSubmit}>
        <Form.Group>
          <Form.Label>Sujet</Form.Label>
          <Form.Control
            type="subject"
            name="subject"
            onChange={handleOnChange}
            //value={email}
            placeholder="Entrez votre addresse email"
            required
          />
        </Form.Group>
        <Form.Group>
          <Form.Label>Date de reclamation</Form.Label>
          <Form.Control
            type="date"
            name="IssueDate"
            onChange={handleOnChange}
            //value={pass}
            placeholder="Mot de passe"
            required
          />
        </Form.Group>
        <Form.Group>
          <Form.Label>Les details</Form.Label>
          <Form.Control
            as="textarea"
            //type="date"
            name="details"
            onChange={handleOnChange}
            //value={pass}
            placeholder="Mot de passe"
            required
          />
        </Form.Group>

        <Form.Group>
          <Form.Label>Priorité</Form.Label>
          <DropdownButton
            alignRight
            title={value}
            id="dropdown-menu-align-right"
            onSelect={handleSelect}
            required
          >
            <Dropdown.Item eventKey="Elevée">Elevée</Dropdown.Item>
            <Dropdown.Item eventKey="Moyenne">Moyenne</Dropdown.Item>
            <Dropdown.Item eventKey="Basse">Basse</Dropdown.Item>
          </DropdownButton>
        </Form.Group>
        <Button type="submit" variant="info">
          Envoyer
        </Button>
      </Form>
    </Jumbotron>
  );
};
